INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (1, 40011, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, "リリ", 24001, 1, 2, 321, 125801, 0);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (2, 40011, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, "クリア", 24001, 1, 2, 322, 126001, 0);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (3, 40011, "んーと。\nこれ、あげる。\nはい", 1, "プレシア", 24001, 1, 2, 323, 126101, 0);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (4, 40011, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, "リリ", 24001, 1, 2, 324, 125801, 0);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (5, 40011, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, "クリア", 24001, 1, 2, 325, 126001, 0);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (6, 40011, "お兄。\nきてくれて、うれしい", 2, "プレシア", 24001, 1, 2, 326, 126101, 0);
